import "./Contact.css"
import React from "react";

const Contact: React.FC = () => {

    return (
        <div className="contact-box">
            <div className="box">
                <div className="contact">
                    <h1>Contact</h1>
                </div>
                <div className="text">
                    <p>
                        Coming soon.
                    </p>
                </div>
            </div>
        </div>
    )
}

export default Contact;
